ия B.Well выявляет самые первые признаки аритмии, позволяя вовремя обратиться к специалисту и предупредить зарождающиеся заболевания сердца.\n\nТехнология Intellect Classic обеспечивает комфортное измерение и точный результат. Начиная измерение, тонометр определяет оптимальный уровень нагнетания манжеты для каждого конкретного человека. Правильный уровень давления в манжете позволяет получить точный результат, избежать излишнего сжатия руки.\n\nКонусная манжета гарантирует комфортное и точное измерение. Анатомическая конусная манжета B.Well идеально облегает руку, равномерно распределяет давление воздуха, обеспечивает безболезненное измерение. Манжета удобна для самостоятельного измерения: конусной форма, специальное металлическое кольцо, широкая застежка позволят легко надеть ее даже одной рукой.\n\nПамять на 30 измерений позволит вести электронный дневник давления за 2 недели.\n\nСъемный чехол манжеты. Очистить манжету можно легко и просто благодаря съемному чехлу, который допускает стирку.\n\nВозможность использования сетевого адаптера делает тонометры не только удобным, но и экономичным (сетевой адаптер входит в комплект).\n\nИндикатор разряда батареи;\nАвтоматическое отключение.\n\nКомплектация:\nПрибор для измерения артериального давления и частоты пульса модель PRO-35;\nМанжета конусная на плечо размера М – L для обхвата плеча 22-42 см;\nСетевой адаптер;\nБатарейки типа ААА – 4 шт;\nГарантийный талон;\nИнструкция по эксплуатации;\nСумка для хранения.\n\nГабариты прибора: 87мм x 122мм x 53мм;\nМанжета для обхвата плеча: 22см~42см;\nВес около 200 г (без батареек и манжеты);\nИсточник питания: пост.ток 6В 600 мА, батареи: 4 х 1.5В РАЗМЕР AAA;\nСрок службы батареек: около 270 циклов накачивания;\nГарантийный срок на электронный блок – 5 лет, манжету – 1 год, сетевой адаптер – 6 месяцев;\nСрок службы приборов B.Well – не менее 10 лет.');
